import { Link } from "react-router-dom";
import classes from "./UkrainianNavigation.module.css";
function UkrainianNavigation() {
  return (
    <nav className={classes.navigation}>
      <Link>Про нас</Link>
      <Link>Номера та ціни</Link>
      <Link>Галерея</Link>
      <Link>Контакти</Link>
    </nav>
  );
}
